import React from "react";
import styles from './mycontact.module.css';

const MyContact = () => {

    return(
        <div className={styles.mycontact}>
            <div className={styles.contact}>
                <p className={address1}>
                    Address Line1: 640 Dr Mary McLeod Bethune Blvd, Florida, United States
                </p>
                <p className={address2}>
                    <Address>Texas</Address>
                </p>
                <p className={email}>
                    <Email>rafboah@gmail.com</Email>
                </p>
                <p className={phone}>
                    <Phone>+13863109162</Phone>
                </p>
            </div>
            <div className={styles.social-media}>
            </div>
        </div>
    );
}

export default MyContact;
